import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';
import AddGreaseProductForm from './AddGreaseProductForm';
import UpdateGreaseProductForm from './UpdateGreaseProductForm';
import DeleteGreaseProductForm from './DeleteGreaseProductForm';

function AdminDashboard() {
    const [enquiries, setEnquiries] = useState([]);
    const [greaseProducts, setGreaseProducts] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const [isAddingProduct, setIsAddingProduct] = useState(false);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [enqRes, prodRes] = await Promise.all([
                    fetch('http://localhost:5000/api/contact'),
                    fetch('http://localhost:5000/api/grease'),
                ]);

                const enqData = await enqRes.json();
                const prodData = await prodRes.json();

                if (!enqRes.ok || !prodRes.ok) throw new Error('Failed to fetch data');

                setEnquiries(enqData);
                setGreaseProducts(prodData);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    const handleLogout = () => {
        localStorage.clear();
        sessionStorage.clear();
        navigate('/');
    };

    const handleDeleteProduct = async () => {
        // Optionally refresh the product list after deletion
        const response = await fetch('http://localhost:5000/api/grease');
        const data = await response.json();
        setGreaseProducts(data);
    };

    return (
        <div className="admin-container">
            <div className="dashboard-header">
                <h2>Customer Enquiries</h2>
                <button className="logout-button" onClick={handleLogout}>Logout</button>
            </div>

            {loading && <p>Loading...</p>}
            {error && <p style={{ color: 'red' }}>{error}</p>}

            <div>
                <h3>Grease Products</h3>
                <button onClick={() => setIsAddingProduct(true)}>Add New Grease Product</button>
                {isAddingProduct && <AddGreaseProductForm onAddProduct={() => setIsAddingProduct(false)} />}

                {greaseProducts.length === 0 ? (
                    <p>No grease products found.</p>
                ) : (
                    <ul className="product-list">
                        {greaseProducts.map((product) => (
                            <li key={product._id} className="product-card">
                                <h4>{product.name}</h4>
                                <p>Price: ${product.price}</p>
                                <p>Stock: {product.stock}</p>
                                <p>Category: {product.category}</p>
                                <p>Offer: {product.offer ? 'Yes' : 'No'}</p>
                                <img src={product.image} alt={product.name} width="100" />

                                {/* Automatically show update and delete forms for each product */}
                                <div className="modal">
                                    <UpdateGreaseProductForm
                                        productId={product._id}
                                        onUpdateProduct={() => console.log('Updated')}
                                    />
                                    <DeleteGreaseProductForm
                                        productId={product._id}
                                        onDeleteProduct={handleDeleteProduct}
                                    />
                                </div>
                            </li>
                        ))}
                    </ul>
                )}
            </div>

            <div>
                <h3>Customer Enquiries</h3>
                {enquiries.length === 0 ? (
                    <p>No enquiries found.</p>
                ) : (
                    <ul className="enquiry-list">
                        {enquiries.map((enquiry, index) => (
                            <li key={index} className="enquiry-card">
                                <p><strong>Name:</strong> {enquiry.name}</p>
                                <p><strong>Email:</strong> {enquiry.email}</p>
                                <p><strong>Message:</strong> {enquiry.message}</p>
                            </li>
                        ))}
                    </ul>
                )}
            </div>
        </div>
    );
}

export default AdminDashboard;
